import React from 'react'
const App=()=>
{
    const purple='#800080'
  function myFun1()
   {
        console.log("You Cliked ")
   }
    function myFun2(){
        console.log("You Double Cliked on me")
    }

   return( 
   <>
   <div>
     <button onClick={myFun1} onDoubleClick={myFun2}>Click Me</button>
    </div>
    </>
    )}
export default App;
